import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { Provider } from 'react-redux';
import store from './store';
import { addLocaleData } from 'react-intl';
import en from 'react-intl/locale-data/en';
import fr from 'react-intl/locale-data/fr';
import he from 'react-intl/locale-data/he';
import { localeSet } from './store/actions/localeActions';
import { Router, Route } from 'react-router-dom';
import  configureHistory  from './configureHistory';
import Intro from './containers/Intro.js'; 
import NavBar from './components/NavBar';
import Reservation from './containers/Reservation.js'; 
import Home from './containers/Home.js'; 
import Tarifs from './containers/Tarifs';
import Contacts from './containers/Contacts';
import Admin from './containers/Admin';

const history = configureHistory()


addLocaleData(en);
addLocaleData(fr);
addLocaleData(he);

if (localStorage.alhubLang) {
    store.dispatch(localeSet(localStorage.alhubLang)
    )};

ReactDOM.render(
<Router history = {history}>
<Provider store={store}>
<App />
<Route exact path="/" component={Intro}/>
          <Route path="/home" component={Home}/>
          <Route path="/reservation" component={Reservation}/>
          <Route path="/tarifs" component={Tarifs}/>
          <Route path="/contacts" component={Contacts}/>
          <Route path="/admin" component={Admin}/>
</Provider>
</Router>, document.getElementById('.container'));


// If you want your app to work offline and load faster, you can change
